import React, { useState } from 'react';

export default function (){

  function testSome(){
    fetch("https://tumbimg.p.rapidapi.com/tumblr-image-search/tel-aviv", {
	"method": "GET",
	"headers": {
		"x-rapidapi-host": "tumbimg.p.rapidapi.com",
		"x-rapidapi-key": "187617f10emsh0ce05444a7d10a2p10d6dcjsnbae35979548e"
	}
})
.then(response => {
	console.log(response);
})
.catch(err => {
	console.log(err);
});
  }

  return (
    <>
    <h1>Hello</h1>
    <button onClick={testSome}>CLICK</button>
    </>
  );
}
